}
function showlist(){
    return a;
}
export default class List extends Component {
    render() {
        return (
            <div>
                Enter user name :<input type="text" placeholder="Enter user name here" id="name" /><br/>
                <button onClick={addListener}>add to List</button>
                <button onClick={removeListener}>add to List</button>
                <button onClick={showlist}>add to List</button>
            </div>
        )
    }
}
